import React from 'react'
import {Button} from 'react-bootstrap'

class StartScreen extends React.Component{
  render(){
    let{gameStart}=this.props
    return(
      <Button onClick={gameStart}>
      Start Game
      </Button>
    )
  }
}


export default StartScreen
